import MarkdownView from 'react-showdown';
import Link from 'next/link';

export default class Post extends Component {
    render() {
        return <div>

            <h4>{this.props.date}</h4>
            <MarkdownView
                markdown={this.props.body}
            />
        </div>
    }
}
